66.Description:
Инновационное средство защиты двигателя на основе синтетических сложных эфиров (масел V группы) ; эстеров (esters); присадка к моторным маслам и к маслам для механических трансмиссий. Подходит ко всем видам двигателей - дизельным и бензиновым, четырёхтактным и двухтактным и ко всем видам масел ; синтетическим, полуcинтетическим, минеральным в том числе и содержащих эфиры (esters).
Молекулы эфиров из присадки примагничиваются к металлическим поверхностям за счёт своей ярко выраженной полярности и создают плотную и очень прочную масляную плёнку, обладающую следующими свойствами:
- Высочайшая нагрузочная способность; что позволяет двигателю и/или трансмиссии работать с повышенными нагрузками без отрицательных последствий;
- Непревзойденные противоизносные и антифрикционные свойства, что значительно увеличивает ресурс двигателя и/или узлов трансмиссии и экономит топливо;
- Антикоррозионные и антиокислительные свойства.

Присадка придаёт маслу следующие свойства:
- Снижает испаряемость, что снижает его расход на угар и продлевает срок службы масла;
- Повышает термоокислительную стабильность, что повышает его стойкость к старению и деградации за счёт чего могут быть увеличены интервалы замены масла;
- Улучшает низкотемпературные свойства, что значительно облегчает холодный пуск и снижает пусковой износ двигателя;
- Улучшает моющие и диспергирующие свойства, предотвращает отложения лаков, смол и шлама, что увеличивает срок службы двигателя и/или трансмиссии и самого масла;
- Проникает в изношенные сальники и резиновые уплотнения, восстанавливает их прежний объем и эластичность, предотвращая утечки масла.

Совместимо со всеми материалами.

Применение: Добавить в масло в соотношении 500 мл на 5 л масла
Рекомендуется для регулярного применения.

73.Description:
MANNOL Molibden Additive – присадка в моторное и/или трансмиссионное (для механических трансмиссий) масло для снижения трения и износа, представляющая собой чрезвычайно стабильную коллоидную дисперсию природного дисульфида молибдена (MoS2) в базовом масле. Образует прочную слоистую плёнку с непревзойдённым антифрикционным эффектом на всех трущихся поверхностях, которая сохраняется даже при полной утечке масла.

Свойства:
- Эффективно снижает коэффициент трения, тем самым снижая крутящий момент и, соответственно, потери энергии, что позволяет значительно экономить топливо;
- Снижает износ, предотвращает заклинивание даже при высоких давлениях и нагрузках за счёт чего значительно продлевает срок службы двигателя и/или узлов механической трансмиссии;
- Обладает высокой термической стабильностью, устойчива к высоким температурам –до 350 С;
- Не образует отложений и осадка;
- Совместима со всеми фильтрами (не забивает их поры) и уплотнениями;
- Смешивается со всеми видами масел (минеральными и синтетическими и т.д.) и применима для любых четырехтактных бензиновых и дизельных двигателей с, турбонаддувом и без, с системами очистки отработавших газов и без них;
- Предотвращает повреждение двигателя и/или трансмиссии в результате экстремальных обстоятельств (утечки масла, очень высоких нагрузок, перегрева и т.д.);
- Снижает шумность двигателя и/или трансмиссии;
- Особенно рекомендуется для техники предыдущих поколений.

Внимание! Дисульфид молибдена неприменим в некоторых узлах, о чём всегда сообщается в инструкции по эксплуатации техники.
Для правильного применения присадки внимательно читайте инструкции по эксплуатации техники!
Не использовать в автоматических трансмиссиях и в трансмиссиях с «мокрыми» сцеплениями!

Применение: Добавить в моторное или трансмиссионное масло в любой произвольный момент времени. Рекомендуется для регулярного использования: при каждой замене масла добавлять в свежее масло. Содержимого банки 0,35 л достаточно для масляной системы объёмом до 5 литров.

83.Description:
Инновационное многофункциональное средство защиты двигателя за счет стабилизации давления в системе смазки – присадка к моторным маслам на основе синтетических сложных эфиров (масел V группы). Представляет собой комплексное средство: стабилизатор вязкости защищающий масло от разжижения, герметик системы смазки двигателя и модификатор трения. Подходит ко всем видам четырехтактных двигателей – дизельным и бензиновым и ко всем видам масел – синтетическим, полуcинтетическим, минеральным, в том числе и содержащих эфиры (esters).

Свойства:
- Восполняет потерю кинематической вязкости (при 100 С) в процессе эксплуатации (особенно при частых холодных пусках), не ухудшая при этом характеристики низкотемпературных свойств;
- Повышает индекс вязкости;
- Уменьшает потерю компрессии в цилиндрах за счет улучшения динамического уплотнения между поршнем и цилиндром, тем самым снижая угар масла за счет предотвращения его попадания в камеру сгорания;
- Устраняет микропротечки, вызванные механическим износом деталей двигателя за счет добавления модификаторов вызывающих закупорку мест этих протечек;
- Проникает в изношенные сальники и резиновые уплотнения, восстанавливает их прежний объем и эластичность, предотвращая утечки масла через них;
- Содержит пакет присадок категорий API SN/CG-4;
- Увеличивает толщину масляной пленки;
- Снижает испаряемость масла, что также снижает его расход на угар и продлевает срок службы масла;
- Повышает термоокислительную стабильность, что повышает его стойкость к старению и деградации за счет чего могут быть увеличены интервалы замены масла;
- Улучшает низкотемпературные свойства, что значительно облегчает холодный пуск и снижает пусковой износ двигателя;
- Улучшает моющие и диспергирующие свойства, предотвращает отложения лаков, смол и шлама, что увеличивает срок службы двигателя и самого масла.

Молекулы эфиров из присадки примагничиваются к металлическим поверхностям за счет своей ярко выраженной полярности и создают плотную и очень прочную масляную пленку, обладающую:
- высочайшей нагрузочной способностью – что позволяет двигателю работать с повышенными нагрузками без отрицательных последствий;
- непревзойденными противоизносными и антифрикционными свойствами, что значительно увеличивает ресурс двигателя и экономит топливо;
- антикоррозионными и антиокислительными свойствами.

Совместимо со всеми конструкционными материалами.
Совместимо со всеми типами систем очистки отработавших газов.
Содержит флуоресцентный краситель для обнаружения утечек.

Применение: Добавить в бак в соотношении 100 мл на 1 л масла.
Рекомендуется для регулярного применения.
